import React from "react";
import SingleMessage from "./SingleMessage"; // Import the new component

export default function Messages({ message, currentUser }) {
  return (
    <ul className="messages-list">
      {message.map((m, index) => (
        <SingleMessage key={index} message={m} currentMember={currentUser} />
      ))}
    </ul>
  );
}
